Mock.mock(/mscx-incubator-api\/roadshow\/getLatestRoadInfo\.do/, {"code":"000000","message":"success","result":[{"roadDesc":"我们为快速消费领域的零售终端提供自动化+互联网解决方案。集合工程、设计、自动化、软件的跨界创新，为商场、酒店、机场、景区、展会、写字楼、学校等需要提供快消服务的地方，开发全自动，同时极具视觉效果的机器人零售终端，用户通过微信选择产品并支付，终端实现24x7快速服务响应。\r\n不久的将来，BoxBot想将整套智能体系应用到更广阔的的工艺和零售领域，将自动化技术大规模应用到服务业，提升人类的创造力和生产力，给客户带来全新颠覆的良好消费体验。","createdTime":1494504716000,"id":51,"thumbnailImg":"./static/e1c16a66095f4fbe90c73e26ba4e32f5.png","roadName":"BoxBot机器人咖啡"},{"roadDesc":"报警110系统，是一个基于3G/4G网络的网络报警联动系统，可支持文字、图片、语音留言和语音视频直播交互，与大数据环境下的警用综合平台融合。\r\n110网络报警: \r\n客户端实名认证，启动报警app，关联到市局110报警平台，实时获取GPS信息，准确定位，可以通过文字、图片、语音和视频进行报警，实时采集现场第一手资料。\r\n警民互动，\r\n信息推送，意见征集，发布预告警示等。\r\n该系统将由公众客户端、web管理后台，与市局指挥中心对接平台等组成，客户端基于安卓及ios平台操作。","createdTime":1494484533000,"id":61,"thumbnailImg":"./static/7cf4e83728e0412c9c235582bf578616.png","roadName":"报警APP"},{"roadDesc":"通过分析交通管理部门对车辆运行状态的监测需求，确定车辆运行状态分类管理层级关系，以此构建物联网条件下车辆运行状态监测系统，并实现车辆运行状态数据的获取，掌握交通事故实时数据，形成人与物、物与物相联，实现车辆信息化、远程管理处置和智能化的网络。物联网就是物物相连的互联网，利用局部网络或互联网等通信技术把传感器、控制器、机器、人员和物等联系在一起，在物物相连的物联网技术条件下，车辆运行状态实时监测和事故数据自动上传更加便捷和有效。从而实现交通事故，特别是公交车、班线客运车、危险品运输车辆等运营车交通事故的及时预警，进一步提升交通事故应急管理工作，丰富政府行业管理部门的应急调度和事故处置功能。","createdTime":1494484468000,"id":59,"thumbnailImg":"./static/87c64646d5084109af2b36ffbe551cf2.png","roadName":"基于物联网的车辆运行状态监测系统"},{"roadDesc":"美丽乡村“村村办”平台是多戈数据根据三四线城市的城市治理需求，结合城乡居民办事实际需求构建的公共服务平台，通过标准化材料输出、贴合居民要求的服务体验、便捷可视化的服务渠道为城乡居民提供各种应用服务的大数据应用平台。\r\n该平台提供我要办事、农技直通车、就业创业、职业培训、融资贷款、政策咨询、公共服务等服务项目。\r\n我要办事是根据城乡居民在社区或村委会办事事务开立证明需要，将各种证明材料进行标准化模板化设计，终端通过身份证识别读取即可完成相关证明材料输出，居民凭输出材料在社区或村委会直接审核用印即可完成相关事项办理，居民办事从原来的15分钟减少到2分钟以内，极大提高工作效率和作业准确性。农技直通车是将村民需要的农业技术培训内容进行梳理和内容制作，形成农业技术的文字、图片、视频化输出，为村民提供足不出村的农业技术培训。就业创业为居民提供就业招聘会推送、就业信息发布、就业人员信息发布、创业培训指导等服务内容，为就业者提供便捷的就业服务和创业扶持等。职业培训是根据区域特点，结合人职业技能培训需求进行的培训发布、培训报名、成绩查询、证书打印等服务构成，满足居民的职业技能培训诉求。融资贷款是通过与人社局、金融机构合作向本地居民发放小额贷款或担保贷款，居民可以在平台上进行贷款申请、贷款追踪等业务办理。政策咨询是将本地各部门发布的政策公告，通过对相关政策公告进行梳理、以微服务形式向各种终端进行政策公告服务提供，满足居民多种服务渠道需求。公共服务是通过各服务渠道进行便民服务、行政公开服务发布与体验，满足居民便捷的信息检索需求。","createdTime":1494484395000,"id":57,"thumbnailImg":"./static/8dd8a4ee0e1e47f8a44aec0f0448fae2.png","roadName":"美丽乡村“村村办”平台"},{"roadDesc":"专业倾向评测\r\nMBTI性格测评，清晰认知自身性格优势\r\n霍兰德兴趣测评，发现自己的兴趣倾向\r\n\r\n国际权威评测，全方面了解自己，找到最合适的专业\r\n1.倾向评测\r\n2.认识自己，选对适合的职业方向 测测你的性格\r\n3.分析亿级简历数据得到对口专业 \r\n\r\n行业最全院校专业百科\r\n‣ 来自考试院的权威招生和录取数据\r\n‣ 4000万真实毕业生案例：毕业薪酬、去向城市、行业和岗位 \r\n‣ 2632所院校数据：资深教育专家和专业编辑团队联手助你了解各大院校以及办学特色\r\n‣ 搜罗来自知乎、贴吧、学校论坛的相应问答，听听学长们对学校和专业的评价\r\n\r\n录取评估和智能填报\r\n录取评估：输入分数/排名，依据“可冲刺”、“较稳妥”、“可保底”的策略来查看院校和专业的录取概率 \r\n志愿智能填报：以“冲稳保”为维度，匹配专业倾向、城市偏好等需求来生成志愿表","createdTime":1494484314000,"id":55,"thumbnailImg":"./static/0220e98feb1e45e3a9cf07bde70afa28.png","roadName":"志愿百科"},{"roadDesc":"基于微信小程序平台的首款协同日程清单，帮助个人在微信上管理自己的行程与任务，主要方便大家协同行程。\r\n上线5天已获得1000用户，简单好用，获得大量用户反馈。石周日程","createdTime":1494468897000,"id":53,"thumbnailImg":"./static/936a23135cfd4a38a85236af43b2cb61.jpg","roadName":"石周日程"},{"roadDesc":"可作为定量反映自主神经功能及其对心血管的调节作用和反应心脏活动正常与否的重要指标。\r\n可以了解帮助预测心脏病的病情和判断预后。\r\n可用于追踪与自主神经活动有关的疾病，如冠心病，糖尿病，心力衰竭，高血压，心脏移植等等。\r\n可以用来作为预测急性心肌梗死的风险和糖尿病性神经病变的早期预警信号。\r\n可作为心源性猝死危险性的一个独立预测指标，在评价心血管疾病的预后和预测急性心血管事件方面具有重要意义。\r\n可作为亚健康心理健康、抑郁情绪、压力自我管理的辅助手段。","createdTime":1494418235000,"id":49,"thumbnailImg":"./static/11b5d8c3e69749cd827d70137cd2d868.png","roadName":"基于视觉的健康自我监测"},{"roadDesc":"通过电子生产档案+视频监控记录+第三方政府监管部门记录来确保数据的真实可靠及食品安全。\r\nRFID射频标识溯源脚环记录养殖场畜禽生产、管理、经营和流通销售等涉及质量安全的重要资料。\r\n网络视频监控记录养殖过程中各个环节的影像资料，防止了记录信息与实际生产情况不符。\r\n食品安全监管部门负责监督生产记录信息的真实性，对生产过程给予评价，并进行不定期抽检。\r\n通过电子生产档案+视频监控记录+第三方政府监管部门记录来确保数据的真实可靠及食品安全。\r\n系统开发符合贵州生态养殖模式，适合当地农户使用的溯源系统，通过相关数据及视频监控向消费者展现贵州优质农产品生长过程，促进产品销售帮助农户脱贫致富。\r\n采用散养模式，生长缓慢，本软件设计配合此养殖流程，突出生态养殖优势。\r\n养殖点分散且无网络无信号，数据采集难、成本高。本软件通过采集终端内置储存空间记录信息，集中汇总等方式解决此问题。\r\n本软件在设计架构时充分考虑养殖户规模小、数量多的问题，采用优化数据及结构流程提高记录和查询效果，减少系统运行时的工作量。\r\n采用接触式信息录入方式，系统固化的程序彻底解决农户因为文化素质低无法录入信息的难题。\r\n本溯源系统目的:\r\n在保障食品安全的同时针对贵州的实际情况还可以达到以下效果：\r\n展示当地优越的自然资源。\r\n实现农产品优质优价。\r\n增加农户收入。","createdTime":1494418023000,"id":47,"thumbnailImg":"./static/f18b64206e1e4305a25394fff10439b3.png","roadName":"黔昊禽畜溯源系统"},{"roadDesc":"驾驶人大数据云平台\r\n项目依托贵州吉源驾驶培训学校产业平台，与北京市计算中心合作，共同促进全国驾培行业数据资源的优化及整合。\r\n1.“强大”的驾培信息化复制平台，建立“强大”的驾培信息化复制平台，帮助全国驾培企业实现信息化科学管理，为广大驾驶人提供更加优质、高效、透明的市场化服务，提高政府对行业的全面监督和管理效能，树立行业管理新标准和新规范,实现驾培行业的转型升级。通过平台输出，联接驾培大数据云平台资源入口，打造跨区域全国性的驾培行业的“Ctrl+C+V”模式，实现驾培行业的信息化科学管理在全国驾培行业的高效复制，打造中国驾培标杆和典范。\r\n2.入口从“买车”前移至“学车”，实现汽车服务入口从“买车”前移至“学车”的转换，通过平台形成的巨大流量入口和精准有效的大数据，开启新的汽车商业价值空间。通过对数据的采集、分析与应用，将“汽车后市场”升级为“驾培后市场”，高黏度的内容和服务将产品优势转化为用户规模优势和流量优势，提前锁定客户。","createdTime":1494417930000,"id":45,"thumbnailImg":"./static/ca768730cbf24023bba21d1644168bf6.png","roadName":"驾培大数据云平台"}],"status":"OK"})

